description:
Head out on the adventurous journey along with the courageous Viking in the new captivating Time Management game Viking Saga. The Viking Ingolf was given a responsible mission by his father King to save their magnificent country form the curse. The cruel dwarf took away a priceless ring and that caused the curse which threatens now not only the King, but the whole kingdom as well. Ingolf managed to get to the unknown island and now he must do everything in order to find the ring and put an end to the curse. Experience an exciting adventure in the new Time Management game Viking Saga. Download this engaging game right now and absolutely for free.
